eval("module.exports = \"<template>\\n  <span class=\\\"content-title\\\"><i class=\\\"fas fa-books\\\" style=\\\"color: #0C4767\\\"></i>\\n    Books</span>\\n  <br>\\n  <br>\\n  <strong>\\n    About People\\n  </strong>\\n  <ul>\\n    <li>\\n      - <strong>The Righteous Mind: Why Good People Are Divided by Politics and Religion</strong> by Jonathan Haidt\\n      <br>\\n      <i>The most influental book I have read so far.</i>\\n    </li>\\n    <li>\\n      - <strong>Thinking Fast and Slow</strong> by Daniel Kahneman\\n      <br>\\n      <i>Some effects are not as strong as stated in the\\n        book but it is still a interesting book.</i>\\n    </li>\\n    <li>\\n      - <strong>Predictably Irrational</strong> by Dan Ariely\\n      <br>\\n      <i>Great book about human decision making.</i>\\n    </li>\\n    <li>\\n      - <strong>The Enigma of Reason</strong> by Hugo Mercier and Dan Sperber\\n      <br>\\n      <i>About human reasoning part of a science thriller around missing citations.</i>\\n    </li>\\n    <li>\\n      - <strong>The Power of Habit: Why We Do What We Do in Life and Business</strong> by Charles Duhigg\\n      <br>\\n      <i>Shows the huge power and danger of habits.</i>\\n    </li>\\n    <li>\\n      - <strong>The Language of Emotions: What Your Feelings Are Trying to Tell You</strong> by Karla McLaren\\n      <br>\\n      <i>Sometimes a little esoteric but full of insights.</i>\\n    </li>\\n    <li>\\n      - <strong>How to win Friends & Influence People</strong> by Dale Carnegie\\n      <br>\\n      <i>A classic about communication.</i>\\n    </li>\\n    <li>\\n      - <strong>Miteinander reden</strong> by Friedemann Schulz von Thun, Andreas Neumann, et al.\\n      <br>\\n      <i>Another classic about communication.</i>\\n    </li>\\n  </ul>\\n\\n  <strong>\\n    About Society\\n  </strong>\\n  <ul>\\n    <li>\\n      - <strong>Utopia for Realists: And How We Can Get There</strong> by Rutger Bregman\\n      <br>\\n      <i>Imagine a bright future.</i>\\n    </li>\\n    <li>\\n      - <strong>The Happiness Hypothesis</strong> by Jonathan Haidt\\n      <br>\\n      <i>Where does happiness come from and where does it go?</i>\\n    </li>\\n    <li>\\n      - <strong>Outliers: The Story of Success</strong> by Malcolm Gladwell\\n      <br>\\n      <i>Success is about being at the right time at the right place.</i>\\n    </li>\\n    <li>\\n      - <strong>Debt - Updated and Expanded: The First 5,000 Years</strong> by David Graeber\\n      <br>\\n      <i>Where does money come from?.</i>\\n    </li>\\n  </ul>\\n\\n  <strong>\\n    Novels\\n  </strong>\\n  <ul>\\n    <li> - <strong>Siddhartha</strong> by Hermann Hesse</li>\\n    <li> - <strong>Brave New World</strong> by Aldous Huxley</li>\\n    <li> - <strong>American Gods</strong> by Neil Gaiman</li>\\n    <li> - <strong>The Expanse 1-8</strong> by James S. A. Corey </li>\\n    <li> - <strong>Das Geheimnis von Askir 1-7</strong> by Richard Schwartz </li>\\n    <li> - <strong>Die Götterkriege 1-7</strong> by Richard Schwartz </li>\\n    <li> - <strong>The Dresden Files 1-15</strong> by Jim Butcher </li>\\n    <li> - <strong>Codex Alera 1-6</strong> by Jim Butcher </li>\\n    <li> - <strong>Harry Potter 1-8</strong> by J.K. Rowling</li>\\n  </ul>\\n</template>\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/about.html\n");

