eval("module.exports = \"<template>\\n    <span class=\\\"content-title\\\"><i class=\\\"fas fa-chart-pie\\\" style=\\\"color: #0C4767\\\"></i>\\n        Embedding Comparison</span>\\n    <p>\\n        The goal of embComp is to support users during the comparison of high dimensional vector spaces or embeddings.\\n        <a class=\\\"link\\\" href=\\\"https://arxiv.org/abs/1911.01542\\\"><i class=\\\"fas fa-long-arrow-right\\\"></i> Publication\\n            (under\\n            review)</a>\\n    </p>\\n    <img src=\\\"https://www.dropbox.com/s/vg8eyxododo7kth/emb.png?dl=1\\\" alt=\\\"EmbComp Interface\\\" style=\\\"width: 100%\\\">\\n    <p>\\n        <strong>Abstract:</strong> <br> This work introduces embComp, a novel approach for comparing two embeddings that\\n        capture the similarity between\\n        objects, such as word and document embeddings. We survey scenarios where comparing these embedding spaces is\\n        useful. From those scenarios, we derive common tasks, introduce visual analysis methods that support these\\n        tasks, and combine them into a comprehensive system. One of embComp's central features are overview\\n        visualizations that are based on metrics for measuring differences in local structure around objects.\\n        Summarizing these local metrics over the embeddings provides global overviews of similarities and differences.\\n        These global views enable a user to identify sets of interesting objects whose relationships in the embeddings\\n        can be compared. Detail views allow comparison of the local structure around selected objects and relating this\\n        local information to the global views. Integrating and connecting all of these components, \\\\sysname supports a\\n        range of analysis workflows that help understand similarities and differences between embedding spaces. We\\n        assess our approach by applying it in several use cases, including understanding corpora differences via word\\n        vector embeddings, and understanding algorithmic differences in generating embeddings.\\n    </p>\\n\\n</template>\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/emb.html\n");

