eval("module.exports = \"<template>\\n  <!-- content -->\\n  <span class=\\\"content-title\\\"><i class=\\\"fas fa-university\\\" style=\\\"color: #0C4767\\\"></i> Teaching</span>\\n  <p>\\n    During winter semesters I teach Visualization and Visual Data Analysis (<a class=\\\"link\\\" target=\\\"_blank\\\"\\n      href=\\\"http://vda.univie.ac.at/Teaching/Vis/19w/schedule.html\\\" style=\\\"display: inline-block;\\\">Course page</a>)\\n    where\\n    I can convey my knowledge about\\n    designing visualizations, dashboards and using Tableau and D3 to create those.\\n    In the summer semesters I teach Human Computer Interaction (<a class=\\\"link\\\" target=\\\"_blank\\\"\\n      href=\\\"http://vda.univie.ac.at/Teaching/HCI/19s/schedule.html\\\" style=\\\"display: inline-block;\\\">Course page</a>)\\n    where\\n    I can my knowledge about design in general\\n    and more specific the design of smartphone apps using the user centered design process and design thinking.\\n  </p>\\n\\n  <p>\\n    Besides teaching at the university I also taught visualization concepts on two deep learning summer schools (<a\\n      class=\\\"link\\\" target=\\\"_blank\\\"\\n      href=\\\"https://datascience.univie.ac.at/news-events/data-science-summer-school-uni-vienna-2018/\\\"\\n      style=\\\"display: inline-block;\\\">2018</a>, <a class=\\\"link\\\" target=\\\"_blank\\\"\\n      href=\\\"https://datascience.univie.ac.at/news-events/detail-news/news/apply-for-data-science-summer-school-2019/?tx_news_pi1%5Bcontroller%5D=News&tx_news_pi1%5Baction%5D=detail&cHash=540a4cf17156c02bfd8de9010b16453a\\\"\\n      style=\\\"display: inline-block;\\\">2019</a>)\\n    and\\n    a qualification seminar for professionals from industry (<a class=\\\"link\\\" target=\\\"_blank\\\"\\n      href=\\\"https://vda.cs.univie.ac.at/research/projects/project/306/\\\" style=\\\"display: inline-block;\\\">Project\\n      Page</a>).\\n  </p>\\n\\n  <p>\\n    I supervise students during bachelor, master thesis and master projects. I am lucky to work with amazing students on\\n    interesting topics in different areas:\\n  </p>\\n  <strong>\\n    Machine learning\\n  </strong>\\n  <ul>\\n    <li>\\n      - Using deep neural networks to extract components from publications.\\n    </li>\\n    <li>\\n      - Validating multi-class classifiers.\\n    </li>\\n    <li>\\n      - Comparing dimensionality reduction methods.\\n    </li>\\n  </ul>\\n\\n  <strong>\\n    Natural Language Processing\\n  </strong>\\n  <ul>\\n    <li>\\n      - PDF structure analysis based on natural language processing.\\n    </li>\\n    <li>\\n      - Comparison of text embedding pipelines.\\n    </li>\\n    <li>\\n      - Visual CLustering of documents based on non-optimal embeddings.\\n    </li>\\n  </ul>\\n\\n  <strong>\\n    Human Computer Interaction\\n  </strong>\\n  <ul>\\n    <li>\\n      - Understanding human biases during usage of correlation visualizations.\\n    </li>\\n    <li>\\n      - Redesigning the ticket ordering process for train tickets.\\n    </li>\\n    <li>\\n      - Using gamification to teach employees about information security.\\n    </li>\\n    <li>\\n      - How to integrate 2nd screen applications during e-sports events.\\n    </li>\\n  </ul>\\n\\n</template>\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/teaching.html\n");

